const {
  TokenizerEn,
  StemmerEn,
  StopwordsEn,
  NormalizerEn,
  registerTrigrams,
} = require('@nlpjs/lang-en-min');
const SentimentEn = require('./sentiment/sentiment_en');

class LangEn {
  register(container) {
    container.use(TokenizerEn);
    container.use(StemmerEn);
